export const iconNames = icons.map((icon) => icon.name)
// console.log(iconNames)

export function Icon(props) {
    const icon = icons.find((icon) => icon.name === props.name)
    const svg = icon.svg(props.tintColor)
    const { text, tint, onTap, ...rest } = props

    return (
        <Frame
            name="container"
            height="100%"
            width="100%"
            background={null}
            style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
            }}
            onTap={onTap}
        >
            {svg}
        </Frame>
    )
}

addPropertyControls(Icon, {
    name: {
        type: ControlType.Enum,
        title: "Icon",
        options: iconNames.sort(),
    },
    tintColor: {
        type: ControlType.Color,
        title: "Color",
        defaultValue: "#4af196",
    },
    onTap: {
        type: ControlType.EventHandler,
    },
})
